import React from "react";
import { MDBInput } from "mdbreact";

const InputPage = () => {
  return (
    <div className="form-group">
     <MDBInput label="Large input" size="lg" />
     <MDBInput label="Medium input" />
     <MDBInput label="Small input" size="sm" />
    </div>
  );
}

export default InputPage;
